extension String {
    
    public var pinyinFirstLetter: String? {
        let array =
        ""
        
        let start = 19968
        let count = 20902
        
        guard characters.count == 1 else { return nil }
        
        let value = Int(unicodeScalars.first!.value)
        
        guard value >= start && value <= start + count else { return nil }
        
        let index = array.startIndex.advancedBy(value - start)
        
        return String(array.characters[index])
    }
}